import styled from 'styled-components'

const Person = styled.div`
  background: #ffffff;
  max-width: 700px;
  border-radius: 3px;
  padding: 50px;
  margin: 0 auto;
  text-align: center;

  h1 {
    font-size: 36px;
    font-weight: bold;
    color: #000000;
    padding: 0 0 30px 0;
  }


`;

export default Person;
